width: 70%;
border: 1px solid;
margin: auto;
`;
const Heading=styled.div`

`
const CardDiv=styled.div`

`
const Image=styled.img`
   width : ;
`


const Card = () => {
  return (
    <Container>
        <Wrapper>
            <Heading></Heading>
            <CardDiv>
                {Latest_newVideo.map((item)=>
                    <Image src={item.img} key={item.id}/>
                )}
            </CardDiv>
        </Wrapper>
    </Container>
  )
}

export default Card
